import React from 'react'
import "./dirilisepisodes.css"
import ReactPlayer from 'react-player'


export const DrirlisEpisode1 = () => {

   return (
      
      <div className='videocop'>
          <ReactPlayer url='https://youtu.be/5fJXATpIiUQ' controls playing={true} muted width="720" height="540%" onEnded
          />
      </div>
    )
  };

  export const DrirlisEpisode2 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='/copadam1.mp4' controls playing={true} muted width="100%" height="100%" onEnded
           />
       </div>
     )
   };

   export const DrirlisEpisode3 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='/copadam1.mp4' controls playing={true} muted width="720" height="720" onEnded
           />
       </div>
     )
   };

   export const DrirlisEpisode4 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='/copadam1.mp4' controls playing={true} muted width="100%" height="100%" onEnded
           />
       </div>
     )
   };
   
   
   export const DrirlisEpisode5 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='/copadam1.mp4' controls playing={true} muted width="100%" height="100%" onEnded
           />
       </div>
     )
   }
